import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <h1>Sudoku Solver</h1>
      <table align='center'>
        <tbody>

            {
              [0,1,2,3,4,5,6,7,8].map((row,rIndex) => {
                return  <tr key={rIndex}>

                {[0,1,2,3,4,5,6,7,8].map((col,cIndex) => {
                  return <td key = {rIndex + cIndex}>
                    <input className='inputsection' />
                  </td>
                })}
                </tr>
              })
            }
        </tbody>
      </table>

    </div>
  );
}

export default App;
